    },
    {
        "hs2Id": 70,
        "hs2dg": 94,
        "description": "เฟอร์นิเจอร์ เครื่องเตียง ฟูก ฐานรองฟูก\nเบาะและสิ่งตกแต่งยัดไส้ที่คล้ายกัน\nเครื่องประทีบโคมไฟ ที่ไม่ได้ระบุหรือรวมไว้ในที่อื่น\nเครื่องหมายที่มีแสงสว่าง แผ่นป้ายชื่อที่มีแสงสว่างและของที่คล้ายกัน รวมทั้งอาคารสำเร็จรูป"
    },
    {
        "hs2Id": 71,
        "hs2dg": 82,
